// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PaperReviewSystem {
    enum ReviewStatus { 
        Submitted,        // Paper initially submitted
        AssignedToReviewer,  // Paper assigned to reviewer
        UnderReview,     // Reviewer is checking the paper
        ReviewCompleted,  // Review process completed
        Rejected,        // Paper rejected
        Accepted         // Paper accepted
    }
    
    struct Paper {
        address author;
        string paperHash;     // IPFS hash of the paper
        ReviewStatus status;
        address assignedReviewer;
        uint256 submissionTime;
        uint256 reviewStartTime;
        uint256 reviewCompletionTime;
        string comments;
    }
    
    // Paper ID => Paper details
    mapping(uint256 => Paper) public papers;
    uint256 public paperCount;
    
    // Reviewer address => boolean (approved or not)
    mapping(address => bool) public approvedReviewers;
    
    // Events for logging
    event PaperSubmitted(uint256 indexed paperId, address indexed author, string paperHash);
    event ReviewerAssigned(uint256 indexed paperId, address indexed reviewer);
    event ReviewStarted(uint256 indexed paperId);
    event ReviewCompleted(uint256 indexed paperId, ReviewStatus status);
    
    // Modifiers
    modifier onlyApprovedReviewer() {
        require(approvedReviewers[msg.sender], "Not an approved reviewer");
        _;
    }
    
    modifier paperExists(uint256 _paperId) {
        require(_paperId < paperCount, "Paper does not exist");
        _;
    }
    
    // Functions
    function submitPaper(string memory _paperHash) external {
        uint256 paperId = paperCount++;
        papers[paperId] = Paper({
            author: msg.sender,
            paperHash: _paperHash,
            status: ReviewStatus.Submitted,
            assignedReviewer: address(0),
            submissionTime: block.timestamp,
            reviewStartTime: 0,
            reviewCompletionTime: 0,
            comments: ""
        });
        
        emit PaperSubmitted(paperId, msg.sender, _paperHash);
    }
    
    function assignReviewer(uint256 _paperId, address _reviewer) 
        external 
        paperExists(_paperId) 
    {
        require(approvedReviewers[_reviewer], "Assigned address is not an approved reviewer");
        require(papers[_paperId].status == ReviewStatus.Submitted, "Paper cannot be assigned");
        
        papers[_paperId].assignedReviewer = _reviewer;
        papers[_paperId].status = ReviewStatus.AssignedToReviewer;
        
        emit ReviewerAssigned(_paperId, _reviewer);
    }
    
    function startReview(uint256 _paperId) 
        external 
        onlyApprovedReviewer 
        paperExists(_paperId) 
    {
        Paper storage paper = papers[_paperId];
        require(paper.assignedReviewer == msg.sender, "Not assigned to this paper");
        require(paper.status == ReviewStatus.AssignedToReviewer, "Paper not ready for review");
        
        paper.status = ReviewStatus.UnderReview;
        paper.reviewStartTime = block.timestamp;
        
        emit ReviewStarted(_paperId);
    }
    
    function completeReview(
        uint256 _paperId, 
        bool _accepted, 
        string memory _comments
    ) 
        external 
        onlyApprovedReviewer 
        paperExists(_paperId) 
    {
        Paper storage paper = papers[_paperId];
        require(paper.assignedReviewer == msg.sender, "Not assigned to this paper");
        require(paper.status == ReviewStatus.UnderReview, "Paper not under review");
        
        paper.status = _accepted ? ReviewStatus.Accepted : ReviewStatus.Rejected;
        paper.reviewCompletionTime = block.timestamp;
        paper.comments = _comments;
        
        emit ReviewCompleted(_paperId, paper.status);
    }
    
    // Getter functions
    function getPaperStatus(uint256 _paperId) 
        external 
        view 
        paperExists(_paperId) 
        returns (
            ReviewStatus status,
            uint256 submissionTime,
            uint256 reviewStartTime,
            uint256 reviewCompletionTime
        ) 
    {
        Paper memory paper = papers[_paperId];
        return (
            paper.status,
            paper.submissionTime,
            paper.reviewStartTime,
            paper.reviewCompletionTime
        );
    }
}
